import React, { Component } from "react";

import Footer from "./Component/Footer";
import Mobileapp from "./Component/Mobileapp";
import BlogNews from "./Component/BlogNews";
import Features from "./Component/Features";
import Customerssays from "./Component/Customerssays";
import Favourite from "./Component/Favourite";
import Totalstatus from "./Component/Totalstatus";
import Restaurents from "./Component/Restaurents";

function App() {
  return (
    <>
      <Restaurents />
      <Totalstatus />
      <Favourite />
      <Customerssays />
      <Features />
      <BlogNews />
      <Mobileapp />
      <Footer />
    </>
  );
}

export default App;
